import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";
const {
  MarkerClusterer
} = require("react-google-maps/lib/components/addons/MarkerClusterer");

const onDragEnd = (coord, i) => {
  const { latLng } = coord;
  const lat = latLng.lat();
  const lng = latLng.lng();

  console.log(`The lat is now : ${lat}, and the lng is now: ${lng}`);
};

const Map = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      defaultZoom={12}
      center={{
        lat: props.startLoc.lat,
        lng: props.startLoc.lng
      }}
      onDragend={props.centerMoved}
      onClick={props.handleClickedMap}
    >
      <MarkerClusterer averageCenter enableRetinaIcons gridSize={15}>
        {props.isMarkerShown &&
          props.markers.map(marker => (
            <Marker
              position={{
                lat: marker.latitude,
                lng: marker.longtitude
              }}
            />
          ))}
      </MarkerClusterer>
    </GoogleMap>
  ))
);

export default Map;

